var lengthOfLongestSubstring = function(s) {
    let subStrArr = []
    
    function getAllSubstrings(str) {
        let i, j, result = [];
      
        for (i = 0; i < str.length; i++) {
            for (j = i + 1; j < str.length + 1; j++) {
                result.push(str.slice(i, j));
            }
        }
        return result;
    }
    if(s===""){
        return 0
    }else{
    
    subStrArr = getAllSubstrings(s)
    function isRepeatingLetters(str){
        let lettersOfString = []
        let isRepeating = false
        for(let i=0; i<str.length; i++){
            let letter = str.slice(i, i+1)
            if(lettersOfString.includes(letter)){
                lettersOfString.push(letter)
                isRepeating = true
                break
            }else{
                lettersOfString.push(letter)
                isRepeating = false
            }
        }
        return isRepeating
    }
    let nonRepeatingStrings = []
    subStrArr.forEach(str => {
        if(!isRepeatingLetters(str)){
            nonRepeatingStrings.push(str)
        }
    })
    
    let longest = nonRepeatingStrings.sort(
        function (a, b) {
            return b.length - a.length;
        }
    )[0]
    
    return longest.length

    }
};
